import React, { useState } from "react";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import Box from "@mui/material/Box";
import { useDispatch } from "react-redux";
import { postBike } from "../store/actions/index";

// Renders the publishing new bike view

const PostBike = () => {
  const [userName, setUserName] = useState("");
  const [postTitle, setPostTitle] = useState("");
  const [address, setAddress] = useState("");
  const [price, setPrice] = useState("");
  const [description, setDescription] = useState("");
  const dispatch = useDispatch();

  console.log(address);

  const submitHandler = ({
    userName,
    postTitle,
    address,
    price,
    description,
  }) => {
    dispatch(
      postBike({
        user: userName,
        address: postTitle,
        price: price,
        available: true,
        description: description,
        title: postTitle,
      })
    );
  };

  return (
    <Box
      component="form"
      sx={{
        "& .MuiTextField-root": { m: 1, width: "25ch" },
      }}
      noValidate
      autoComplete="off"
    >
      <div>
        <TextField
          required
          id="outlined-required"
          label="Tu nombre :)"
          defaultValue={userName}
        />
        <TextField
          required
          id="outlined-required"
          label="Título de tu publicación"
          defaultValue={postTitle}
        />
        <TextField
          required
          id="outlined-required"
          label="Dirección de retiro"
          value={address}
          onBlur={(input) => setAddress(input)}
        />
        <TextField
          required
          id="outlined-required"
          label="Precio por día"
          defaultValue={price}
        />
        <TextField
          required
          id="outlined-required"
          label="Descripción del anuncio"
          defaultValue={description}
        />
      </div>
      <Button variant="contained" color="warning" onClick={submitHandler}>
        Publicar
      </Button>
    </Box>
  );
};

export default PostBike;
